import { Link } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { useState, useEffect, useRef } from "react";
import { logout } from "../redux/slices/authSlice"; // <-- Update the path if different

export default function Header() {
  const { userInfo, isAuthenticated } = useSelector((state) => state.auth);
  const dispatch = useDispatch();

  const [menuOpen, setMenuOpen] = useState(false);
  const menuRef = useRef(null);

  // Close dropdown when clicked outside
  useEffect(() => {
    const handleClickOutside = (e) => {
      if (menuRef.current && !menuRef.current.contains(e.target)) {
        setMenuOpen(false);
      }
    };
    document.addEventListener("click", handleClickOutside);
    return () => document.removeEventListener("click", handleClickOutside);
  }, []);

  const handleLogout = () => {
    dispatch(logout());
  };

  return (
    <div className="header-container">
      <div className="container-fluid">
        <div className="header">
          {/* Logo */}
          <div className="logo">
            <Link to="/">
              <img
                src={`${process.env.PUBLIC_URL}/assets/images/aayologo.png`}
                alt="Aayo"
              />
            </Link>
          </div>

          {/* Navigation */}
          <div className="nav">
            <ul>
              <li>
                <Link
                  to="/"
                  className={({ isActive }) => (isActive ? "active" : "")}
                >
                  Home
                </Link>
              </li>
              <li>
                <Link to="/features">Features</Link>
              </li>
              <li>
                <Link to="/about">About Us</Link>
              </li>
              <li>
                <Link to="/how-it-works">How It Works</Link>
              </li>
              <li>
                <Link to="/faq">FAQ</Link>
              </li>
              <li>
                <Link to="/contact">Contact Us</Link>
              </li>
            </ul>
          </div>

          {/* Right Side Buttons */}
          <div className="button" ref={menuRef}>
            {!userInfo ? (
              <>
                <Link to="/login" className="btn btn-blank">
                  Sign In
                </Link>
                <Link to="/register" className="btn btn-fill">
                  Sign Up
                </Link>
              </>
            ) : (
              <>
                <button
                  type="button"
                  className="btn btn-blank usermenu-toggle"
                  onClick={() => setMenuOpen(!menuOpen)}
                >
                  <img
                    src={`${process.env.PUBLIC_URL}/assets/images/thumb-driver.png`}
                    alt={userInfo.name}
                  />
                  {userInfo.name}{" "}
                  <span className="material-icons-outlined">
                    arrow_drop_down
                  </span>
                </button>

                {menuOpen && (
                  <div className="usermenu-toggle-content">
                    <ul>
                      <li>
                        <Link to="/profile">Profile</Link>
                      </li>
                      <li>
                        <Link to="/change-password">Change Password</Link>
                      </li>
                      <li>
                        <button
                          onClick={handleLogout}
                          className="btn-link"
                          style={{
                            background: "none",
                            border: "none",
                            color: "#333",
                            cursor: "pointer",
                            padding: "0",
                          }}
                        >
                          Sign Out
                        </button>
                      </li>
                    </ul>
                  </div>
                )}
              </>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}
